import React from 'react';
import styled from 'styled-components';
import Rectangle from '../common/Rectangle';

const Wrapper = styled.section`
  border: 1.5px solid #FEA82F;
  border-radius: 10px;

  .qwer {
    display: flex;
    
  }

  .asdf {
    margin: 35px 70px 35px 70px;
    display: flex;
    flex-direction: column;
  }

  .asdfgh {
  margin-bottom: 25px;

  font-family: Roboto;
  font-style: normal;
  font-weight: bold;
  font-size: 24px;
  line-height: 36px;
  }

    .asdf > p { /* 자식 p태그 */
      font-family: Roboto;
      font-style: normal;
      font-weight: bold;
      font-size: 20px;
      line-height: 36px;
    }

  .ghjk {
    display: flex;
    justify-content: space-around;
    margin-top: 65px;
  }

  .sdfg {
    display: inline-block;
    margin-right: 10px;

    width: 60px;
    height: 60px;

    border: 1px solid #C4C4C4;
    box-sizing: border-box;
    border-radius: 5px;

    cursor: pointer;
  }

  .zxcv {
    margin: 12px;
    width: 32px;
    height: 32px;
  }

  .uiop {
    margin: 18px 62px 18px 62px;

    font-family: Roboto;
    font-style: normal;
    font-weight: bold;
    font-size: 16px;
    line-height: 23px;
    display: flex;
    align-items: center;
    text-align: center;
    letter-spacing: -0.015em;

    color: #FFFFFF;
  }

`;



const Summary = (props) => {
  return <>
  <Wrapper>
    <div className="qwer">
      <img src="assets/images/summary.png" alt="img" />
      <div className="asdf">
        <h2 className="asdfgh"><img src="assets/images/icons/book.png" alt="icon" /> 독서모임 이름</h2>
        <p><img src="assets/images/icons/people.png" alt="icon" /> 독서모임 인원</p>
        <p><img src="assets/images/icons/schedule.png" alt="icon" /> 독서모임 일정</p>
        <p><img src="assets/images/icons/subject.png" alt="icon" /> 독서모임 주제</p>
        <div className="ghjk">
          <div className="sdfg">
            <img className="zxcv" src="assets/images/icons/heart.png" alt="icon" />
          </div>
            <Rectangle>
              <p className="uiop">참여 신청</p>
            </Rectangle>
        </div>
      </div>
    </div>
  </Wrapper>
    
  </>;
};

export default Summary;
